import React, { useState, useContext } from "react";
import {Button} from "antd";
import { MdApps, MdHome, MdPeople, MdNotifications, MdAccountCircle, MdSettings, MdPowerSettingsNew } from "react-icons/md";

import Sidenav from "../../components/Sidenav"
import {DataSessionContext, DataUserContext} from "../../utils";
import {Home, Stations, Users, Messages} from "./pages";


export default function HomeAdmin(props) {

    const user = useContext(DataUserContext);

    const [currentPage, setCurrentPage] = useState(Home)
    const [listTopBar, setListTopBar] = useState({
        header: [
            { _id: "home", title: "Accueil", component: <MdHome/>, active: false },
            { _id: "station", title: "Station", component: <MdApps/>, active: false },
            { _id: "users", title: "Utilisateurs", component: <MdPeople/>, active: false },
            { _id: "message", title: "Messages", component: <MdNotifications/>, active: false },
        ],

        footer: [
            { _id: "profile", title: "Profile", component: <MdAccountCircle/>, active: false },
            { _id: "setting", title: "Paramètre", component: <MdSettings/>, active: false },
        ]
    });

    return (
        <div className="app--wrapper">
            <Sidenav {...listTopBar} />
            <div className="app--content">
                {currentPage}
               <p>Je suis dans l'admin <Button type="danger" onClick={() => props.history.push("/logout")}>Déconnexion</Button></p>
            </div>
        </div>
    )
}
